import React from "react";
import {
  Button,
  Header,
  Image,
  Modal,
  Form,
  Input,
  TextArea,
} from "semantic-ui-react";

export function QuestionModal() {
  const [open, setOpen] = React.useState(false);

  return (
    <Modal
      style={{ height: 200, position: "fixed" }}
      onClose={() => setOpen(false)}
      onOpen={() => setOpen(true)}
      open={open}
      trigger={<Button>Create</Button>}
    >
      <Modal.Header>Select a Photo</Modal.Header>
      <Modal.Content>
        <Modal.Description>
          <Header>Add a topic</Header>
          <Form>
            <Form.Group>
              <Form.Field
                control={Input}
                label="topic"
                placeholder="Add a topic"
              />
            </Form.Group>
            <Form.Field
              control={TextArea}
              label="About"
              placeholder="Add a topic description"
            />

            <Form.Field control={Button}>Submit</Form.Field>
          </Form>
          )
        </Modal.Description>
      </Modal.Content>
      <Modal.Actions>
        <Button color="black" onClick={() => setOpen(false)}>
          Nope
        </Button>
        <Button
          content="Yep, that's me"
          labelPosition="right"
          icon="checkmark"
          onClick={() => setOpen(false)}
          positive
        />
      </Modal.Actions>
    </Modal>
  );
}
